column1:
Driving on the highway.

@MrsDocAtCDI : Hey, you just missed a right!

Me: Thanks babe. You're Mrs. Right!

Found in an advice page;
Question: My child wont eat meat, with what can I replace it?

Answer: A dog. Dogs love meat

for those of you asking:

do ya know where my jokes come from?

I get them from my dad-a-base...

I’ve just been house hunting.

One place had mirrors covering the walls of every room.

@AndrewBraganza said he thought, he could see himself living there!

Couples Therapist: So, tell me what brings you here today?

@MrsDocAtCDI: It’s so difficult living with him - he takes everything so literally.

Me: A truck.

if you cant tie a knot, 
you cannot.
if you can tie a knot, 
you can knot.

My Dads advice some years ago;

If you get into a fight in the pub, put a pool ball in your sock

Worst advice ever, I could hardly walk!

I love anagrams;

If you re-arrange the letters of ‘A Postal carrier’ 
they get annoyed.

@MrsDocAtCDI: At least invite me out to dinner.

Me: I don’t go out with married women.

@MrsDocAtCDI: But I’m your wife.

Me: I make no exceptions.

for those of you wondering what my wife thinks about my girlfriend, 

my girlfriend is like the square root of -100.

A solid 10, but also imaginary.

Boy asks Grandad;
Have you seen my pills,they were labelled LSD?

Grandad replies;
Never mind the pills, have you seen the dragons in the kitchen?!
